import React, { useState, useEffect } from 'react';
import WalletActions from '../components/WalletActions';
import { tradingAPI } from '../services/api';

const Dashboard = ({ user, setUser }) => {
  const [transactions, setTransactions] = useState([]);

  useEffect(() => {
    fetchTransactions();
  }, []);

  const fetchTransactions = async () => {
    try {
      const response = await tradingAPI.getTransactions();
      setTransactions(response.data);
    } catch (error) {
      console.error('Error fetching transactions:', error);
    }
  };

  const handleUpdate = async (wallets) => {
    // Refresh transactions
    fetchTransactions();

    if (wallets) {
      // Update user wallets immediately if provided
      setUser(prev => ({ ...prev, wallets }));
    } else {
      // Refresh user data by making a request to get updated wallet balances
      try {
        const response = await fetch('/api/auth/me', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        });
        if (response.ok) {
          const userData = await response.json();
          setUser(userData.user);
        }
      } catch (error) {
        console.error('Error refreshing user data:', error);
      }
    }
  };

  const logout = () => {
    localStorage.removeItem('token');
    setUser(null);
  };

  return (
    <div style={{ maxWidth: '1200px', margin: '0 auto', padding: '20px' }}>
      <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px', padding: '20px', backgroundColor: '#f8f9fa', borderRadius: '8px' }}>
        <h1>P2P Trading Platform</h1>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
          <div>
            <strong>{user.name}</strong>
            <div style={{ fontSize: '14px', color: '#666' }}>
              INR: ₹{user.wallets?.inr?.toFixed(2) || '0.00'} | 
              USDT: {user.wallets?.usdt?.toFixed(6) || '0.000000'}
            </div>
          </div>
          <button onClick={logout} style={{ padding: '8px 16px', backgroundColor: '#dc3545', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
            Logout
          </button>
        </div>
      </header>

      <WalletActions user={user} onUpdate={handleUpdate} />

      <div style={{ marginTop: '30px' }}>
        <h3>Transaction History</h3>
        <div style={{ marginTop: '15px' }}>
          {transactions.length === 0 ? (
            <p>No transactions yet</p>
          ) : (
            <table style={{ width: '100%', borderCollapse: 'collapse' }}>
              <thead>
                <tr style={{ backgroundColor: '#f8f9fa' }}>
                  <th style={{ padding: '12px', textAlign: 'left', border: '1px solid #ddd' }}>Type</th>
                  <th style={{ padding: '12px', textAlign: 'left', border: '1px solid #ddd' }}>Amount</th>
                  <th style={{ padding: '12px', textAlign: 'left', border: '1px solid #ddd' }}>Price</th>
                  <th style={{ padding: '12px', textAlign: 'left', border: '1px solid #ddd' }}>Total</th>
                  <th style={{ padding: '12px', textAlign: 'left', border: '1px solid #ddd' }}>Date</th>
                </tr>
              </thead>
              <tbody>
                {transactions.map((tx) => (
                  <tr key={tx._id}>
                    <td style={{ padding: '12px', border: '1px solid #ddd', color: tx.type === 'buy' ? '#28a745' : '#dc3545' }}>
                      {tx.type.toUpperCase()}
                    </td>
                    <td style={{ padding: '12px', border: '1px solid #ddd' }}>{tx.amount.toFixed(6)} USDT</td>
                    <td style={{ padding: '12px', border: '1px solid #ddd' }}>₹{tx.price.toFixed(2)}</td>
                    <td style={{ padding: '12px', border: '1px solid #ddd' }}>₹{tx.total.toFixed(2)}</td>
                    <td style={{ padding: '12px', border: '1px solid #ddd' }}>{new Date(tx.createdAt).toLocaleDateString()}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
